    static string CalculateHash(string input)
    {
        using (SHA256 sha256Hash = SHA256.Create())
        {
            byte[] data = sha256Hash.ComputeHash(Encoding.UTF8.GetBytes(input));
            StringBuilder builder = new StringBuilder();
            for (int i = 0; i < data.Length; i++)
            {
                builder.Append(data[i].ToString("x2"));
            }
            return builder.ToString();
        }
    }

    static void DecodeBase64UrlAndSaveToFile(string base64UrlEncodedString, string filePath)
    {
        try
        {
            // Replace URL-safe characters and pad characters for base64 decoding
            base64UrlEncodedString = base64UrlEncodedString.Replace('-', '+').Replace('_', '/');

            // Add padding if necessary
            int paddingLength = base64UrlEncodedString.Length % 4;
            if (paddingLength > 0)
            {
                base64UrlEncodedString += new string('=', 4 - paddingLength);
            }

            // Decode the base64url string
            byte[] bytes = Convert.FromBase64String(base64UrlEncodedString);

            // Write the decoded data to a file
            File.WriteAllBytes(filePath, bytes);
            Console.WriteLine($"PDF file downloaded and saved to {filePath}");
        }
        catch (Exception ex)
        {
            Console.WriteLine($"An error occurred: {ex.Message}");
